  NUM_COPPIE: 6,
};

export const CARD_IMAGES = [
  { src: "/img/red.png", matched: false },
  { src: "/img/yellow.png" },
  { src: "/img/green.png" },
  { src: "/img/blue.png" },
  { src: "/img/light_blue.png" },
  { src: "/img/pink.png" },
